import math

def generate_primes(start, end):
    primes = []
    for num in range(start, end - 1):
        if num < 2:
            continue
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                break
        else:
            primes.append(num)
    return primes

